import styled from "styled-components";
import { Project } from "../../types/project";

const All = ({ projectData }: { projectData: Project[] }) => {
  return (
    <Wrap>
      {projectData.map((project) => (
        <Content key={project.id}>
          <div>
            <h2>{project.title}</h2>
            <div>
              <span>
                <a
                  href={project.link}
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  배포 링크
                </a>
              </span>
              <span>
                <p>Git </p> {project.git}
              </span>
            </div>
            <span>{project.date}</span>
            <span>
              <p>기간</p> {project.term}
            </span>
            <span>
              <p>Content</p> {project.content}
            </span>
            <span>
              <p>Review</p> {project.review}
            </span>
            <span>
              <p>Role</p> {project.role.join(", ")}
            </span>
            <span>
              <p>Skill</p> {project.skill.join(", ")}
            </span>
          </div>
        </Content>
      ))}
    </Wrap>
  );
};

export default All;

const Wrap = styled.div`
  display: flex;
  width: 100%;
  height: 100%;
  justify-content: center;
  align-items: center;
`;
